INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `id_shop`, `meta_title`, `head_seo_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`) VALUES
(1, 1, 1, 'Dostawy', '', 'Nasze warunki i zasady dostawy', 'warunki dostawy, zasady dostawy, regulamin dostawy, nasze warunki dostawy', '<h2>Przesyłki i zwroty</h2>\n<h3>Twoja przesyłka</h3>\n<p>Paczki zazwyczaj opuszczają nasze magazyny w ciągu 2 dni od momentu zaksięgowania płatności i są dostarczane przez firmę UPS w ciągu 2-3 dni roboczych z możliwością śledzenia. Jeżeli preferujesz dostawę poprzez InPost, oczekuj na nią 1-2 dni robocze. Bez względu na wybraną opcję dostawy, otrzymasz od nas link umożliwiający śledzenie paczki online.</p>\n<p>Opłaty za dostawę zawierają stałe opłaty manipulacyjne, koszty opakowania, oraz opłaty za przesyłkę. Opłaty manipulacyjne są ustalone, natomiast koszty transportu zależą od wartości zamówienia. Przesyłki o wadze przekraczającej 50 kg nie są obsługiwane. Zalecamy grupowanie zamówionych przedmiotów w jednym zamówieniu. Niestety, nie jesteśmy w stanie łączyć dwóch osobnych zamówień, a opłaty za dostawę naliczane są dla każdego z nich. Warto jednak pamiętać, że Twoja paczka będzie wysyłana na Twoje własne ryzyko, choć szczególną uwagę poświęcamy zabezpieczeniu delikatnych przedmiotów.</p>\n<p>Nasze pudełka są odpowiednio przestronne, a Twoje przedmioty starannie zabezpieczone.</p>', 'dostawy'),
(2, 1, 1, 'Ogłoszenie prawne', '', 'Legal notice', 'Informacje prawne, Zasługi, Koncepcja i produkcja', '<h2>Informacje prawne</h2>\n<h3>Zasługi</h3>\n<p>Koncepcja i produkcja:</p>\n<p>Ta witryna internetowa została utworzona przy użyciu oprogramowania open-source PrestaShop™.</p>', 'ogloszenie-prawne'),
(3, 1, 1, 'Regulamin korzystania', '', 'Regulamin korzystania', '', '<h2>Twoje warunki korzystania</h2>\n<h3>Zasada 1: Wybór i Zamówienia</h3>\n<p>1.1. Klienci mogą przeglądać naszą ofertę produktów związanych z odzieżą.</p>\n<p>1.2. Dokonując zamówienia, klient zobowiązuje się do zakupu wybranych produktów.</p>\n<p>1.3. Zamówienia można składać za pośrednictwem naszej strony internetowej, a także podczas wizyt w naszym sklepie stacjonarnym.</p>\n<h3><span style=\"font-size:12.87px;\">Zasada 2: Płatności i Dostawy</span></h3>\n<p>2.1. Cena każdego produktu jest podana w polskich złotych i zawiera podatek VAT.</p>\n<p>2.2. Klienci mogą dokonywać płatności za zamówienia za pośrednictwem różnych metod, takich jak karty kredytowe, przelewy bankowe itp.</p>\n<p>2.3. Wszystkie dostawy są realizowane przy użyciu renomowanych firm kurierskich, aby zapewnić szybką i bezpieczną dostawę zakupionych produktów.</p>\n<h3>Zasada 3: Zwroty i Reklamacje</h3>\n<p>3.1. Klienci mają prawo do zwrotu produktów w ciągu określonego okresu, jeśli nie są zadowoleni z zakupu.</p>\n<p>3.2. W przypadku otrzymania produktu wadliwego lub uszkodzonego, klient ma prawo złożyć reklamację, a my podejmiemy odpowiednie kroki w celu rozwiązania problemu.</p>\n<h3>Zasada 4: Ochrona Danych Osobowych</h3>\n<p>4.1. Dbamy o ochronę danych osobowych klientów i stosujemy wszelkie środki bezpieczeństwa, aby chronić prywatność naszych klientów.</p>\n<p>4.2. Dane osobowe są używane wyłącznie w celu realizacji zamówień i świadczenia usług zgodnie z obowiązującymi przepisami dotyczącymi ochrony danych osobowych.</p>', 'regulamin-korzystania'),
(4, 1, 1, 'O nas', '', 'Dowiedz się więcej o nas', '', '<h2>O nas</h2>\n<h3>Nasza firma</h3>\n<p>H&amp;M to międzynarodowa sieć sklepów odzieżowych, która powstała w 1947 roku w Szwecji. Zaczynając od skromnych korzeni, rozwinęliśmy się, aby stać się jednym z liderów branży mody na całym świecie. Nasze sklepy oferują szeroki wybór ubrań damskich, męskich i dziecięcych, a także akcesoriów modowych.</p>\n<h3>Nasz Zespół</h3>\n<p>Jesteśmy dumni z wielokulturowego i zdolnego zespołu, który stale pracuje nad tym, aby dostarczać naszym klientom najnowsze trendy i unikalne projekty. Dążymy do tego, aby nasi klienci czuli się pewnie i stylowo, nosząc nasze ubrania. Nasz zespół składa się z pasjonatów mody, projektantów, sprzedawców i wielu innych specjalistów, którzy wspólnie tworzą niepowtarzalny charakter marki H&amp;M.</p>\n<h3>Informacje</h3>\n<p>W naszym sklepie znajdziesz aktualne kolekcje, inspiracje modowe oraz wiele informacji dotyczących najnowszych trendów w świecie mody. Dbamy o to, aby nasze ubrania były nie tylko stylowe, ale także dostępne dla różnych budżetów. Dziękujemy, że jesteś z nami i mamy nadzieję, że zakupy w naszym sklepie przyniosą Ci satysfakcję i radość.</p>', 'o-nas'),
(5, 1, 1, 'Bezpieczna płatność', '', 'Nasze środki bezpiecznej płatności', 'secure payment, ssl, visa, mastercard, paypal', '<h2>Bezpieczna płatność</h2>\n<h3>Nasza bezpieczna płatność</h3>\n<p>Nasza strona internetowa korzysta z technologii SSL (Secure Socket Layer), co oznacza, że Twoje dane są bezpieczne podczas procesu płatności. Protokół SSL gwarantuje szyfrowanie informacji przekazywanych między Twoim urządzeniem a naszym serwerem, co chroni je przed nieautoryzowanym dostępem. Dzięki temu możesz śmiało korzystać z różnych metod płatności, takich jak Visa, Mastercard czy Paypal, mając pewność, że Twoje dane są zabezpieczone.</p>\n<h3></h3>\n<h3>Korzystając z Visa/Mastercard/Paypal</h3>\n<p>Oferujemy różne bezpieczne metody płatności, aby zapewnić naszym klientom wygodę i pewność podczas dokonywania zakupów. Nasza strona jest zabezpieczona protokołem SSL, co gwarantuje bezpieczne przekazywanie danych.</p>\n<h3><span style=\"font-size:12.87px;\"></span></h3>\n<h3><span style=\"font-size:12.87px;\">Płatność przy odbiorze</span></h3>\n<p><span style=\"font-size:12.87px;\">Dla dodatkowego komfortu oferujemy również opcję płatności przy odbiorze. Możesz uregulować należność gotówką lub kartą bezpośrednio kurierowi podczas dostawy Twojego zamówienia. To wygodne rozwiązanie dla tych, którzy woleliby opłacić swoje zakupy po otrzymaniu paczki.</span></p>', 'bezpieczna-platnosc');
