(188589001, 1, 1, 'Podwójna pościel ze spranego miękkiego lnu zapewniającego wygodny sen. Poszwa na kołdrę zapinana u dołu na kryte metalowe zatrzaski. Dwie kopertowe poszewki na poduszkę. Len jest wytrzymałym materiałem i przy odpowiedniej pielęgnacji posłuży przez długi czas, a z każdym praniem stanie się bardziej miękki i atrakcyjny. Lniana pościel to dobry wybór dla osób, którym jest zbyt ciepło podczas snu, ponieważ materiał ten absorbuje wilgoć, zapewniając przyjemny chłód i komfort. Gęstość 104.', '', 'komplet-lnianej-poscieli-podwojnej', '', '', '', 'Komplet lnianej pościeli podwójnej', '', '', '', ''),
