(595261023, 1, 1, 'Koc z miękkiej żakardowej tkaniny z frędzlami na krótkich bokach.', '', 'koc-z-zakardowej-tkaniny', '', '', '', 'Koc z żakardowej tkaniny', '', '', '', ''),
(616624006, 1, 1, 'Uniwersalny kosmetyk w sztyfcie, który doda delikatnego blasku wargom, policzkom i oczom. Kremowa konsystencja pozostawia połysk za jednym pociągnięciem, a wygodna forma wykręcanego sztyftu doskonale sprawdzi się jako podręczny kosmetyk w torebce lub podczas podróży. 6,5 g.', '', 'wielofunkcyjny-sztyft', '', '', '', 'Wielofunkcyjny sztyft', '', '', '', ''),
(616624007, 1, 1, 'Uniwersalny kosmetyk w sztyfcie, który doda delikatnego blasku wargom, policzkom i oczom. Kremowa konsystencja pozostawia połysk za jednym pociągnięciem, a wygodna forma wykręcanego sztyftu doskonale sprawdzi się jako podręczny kosmetyk w torebce lub podczas podróży. 6,5 g.', '', 'wielofunkcyjny-sztyft', '', '', '', 'Wielofunkcyjny sztyft', '', '', '', ''),
(616624009, 1, 1, 'Uniwersalny kosmetyk w sztyfcie, który doda delikatnego blasku wargom, policzkom i oczom. Kremowa konsystencja pozostawia połysk za jednym pociągnięciem, a wygodna forma wykręcanego sztyftu doskonale sprawdzi się jako podręczny kosmetyk w torebce lub podczas podróży. 6,5 g.', '', 'wielofunkcyjny-sztyft', '', '', '', 'Wielofunkcyjny sztyft', '', '', '', ''),
(618419002, 1, 1, 'Średnio miękka kredka do ust, która podkreśla i doskonali naturalny kontur warg. Kremowa formuła łatwo się rozciera, ale jest odporna na rozmazywanie się i ścieranie. 1,2 g. Sposób użycia: obrysować kontur warg i delikatnie rozetrzeć na pomadkę, tworząc naturalny efekt.', '', 'konturowka-do-ust', '', '', '', 'Konturówka do ust', '', '', '', ''),
(629205001, 1, 1, 'Dwustronny aplikator: na jednym końcu pędzelek do nakładania eyelinera i cieni do brwi, na drugim szczoteczka do nakładania mascary oraz rozdzielania i podkreślania rzęs i brwi. Włosie syntetyczne.', '', 'szczoteczka-do-brwi-i-rzes', '', '', '', 'Szczoteczka do brwi i rzęs', '', '', '', ''),
(643448011, 1, 1, 'Pościel we wzorzyste nadruki wykonana z miękkiej tkaniny z mieszanki lyocellu i bawełny. Jedna poszewka na poduszkę. Gęstość 144.', '', 'komplet-poscieli-pojedynczej', '', '', '', 'Komplet pościeli pojedynczej', '', '', '', ''),
(655210001, 1, 1, 'Pościel z wzorzystej miękkiej flaneli bawełnianej. U dołu zapięcie na metalowe zatrzaski. Jedna kopertowa poszewka na poduszkę.', '', 'komplet-flanelowej-poscieli-pojedynczej', '', '', '', 'Komplet flanelowej pościeli pojedynczej', '', '', '', ''),
(655211001, 1, 1, 'Podwójna pościel z wzorzystej miękkiej flaneli bawełnianej. U dołu zapięcie na metalowe zatrzaski. Dwie kopertowe poszewki na poduszkę.', '', 'komplet-flanelowej-poscieli-podwojnej', '', '', '', 'Komplet flanelowej pościeli podwójnej', '', '', '', ''),
(674529014, 1, 1, 'Koc z miękkiego polaru z tkaninowym wierzchem o strukturalnym splocie.', '', 'polarowy-koc', '', '', '', 'Polarowy koc', '', '', '', ''),
(691573020, 1, 1, 'Pojedyncza narzuta na łóżko wykonana z tkaniny o waflowej strukturze z mieszanki zawierającej bawełnę.', '', 'narzuta-w-waflowy-splot', '', '', '', 'Narzuta w waflowy splot', '', '', '', ''),
(696125001, 1, 1, 'Spodnie sportowe z szybkoschnącego materiału funkcjonalnego z poliestru. Elastyczna talia z krytym sznurkiem, kieszenie w szwach bocznych, mankiet u dołu nogawek.', '', 'spodnie-sportowe', '', '', '', 'Spodnie sportowe', '', '', '', ''),
(698608001, 1, 1, 'Nieodzowna paleta do makijażu twarzy zawierająca wszystko, czego potrzeba, aby stworzyć nieskazitelny promienny look. Użyj różu, aby dodać nieco koloru, rozświetlacza, aby nadać całości promienny blask i brązera, aby stworzyć efekt lekkiej opalenizny. 3 x 4,2 g.', '', 'paleta-do-makijazu', '', '', '', 'Paleta do makijażu', '', '', '', ''),
(698608002, 1, 1, 'Nieodzowna paleta do makijażu twarzy zawierająca wszystko, czego potrzeba, aby stworzyć nieskazitelny promienny look. Użyj różu, aby dodać nieco koloru, rozświetlacza, aby nadać całości promienny blask i brązera, aby stworzyć efekt lekkiej opalenizny. 3 x 4,2 g.', '', 'paleta-do-makijazu', '', '', '', 'Paleta do makijażu', '', '', '', ''),
(703672025, 1, 1, 'Koszula z krótkim rękawem wykonana z wzorzystej tkaniny z lyocellu. Normalny fason. Wykładany kołnierzyk, gładka listwa z zapięciem, u dołu prosty brzeg z rozcięciami po bokach. Materiał wykonany z lyocellu jest bardzo miękki, odporny na zagniecenia i pięknie się układa.', '', 'koszula-z-krotkim-rekawem-z-lyocellu-regular-fit', '', '', '', 'Koszula z krótkim rękawem z lyocellu Regular Fit', '', '', '', ''),
