(826268001, 1, 1, 'Nowoczesny lakier do paznokci łączący intensywne kolory z trwałą, żelową formułą nie wymagającą stosowania lampy UV. Specjalnie opracowany do stosowania razem z Gel Studio Top Coat, aby zapewnić trwałość i intensywność koloru. Dostępny w szerokiej gamie naszych najpopularniejszych kolorów oraz w kilku zupełnie nowych, ekskluzywnych odcieniach. 8 ml. Sposób użycia: nałożyć dwie warstwy Gel Studio Nail Colour, pozostawić na 2 minuty do wyschnięcia. Następnie nałożyć Gel Studio Top Coat.', '', 'zelowy-lakier-do-paznokci', '', '', '', 'Żelowy lakier do paznokci', '', '', '', ''),
