(1068626001, 1, 1, 'Obcinacz do paznokci wykonany ze stali węglowej. Pomoże Ci bezpiecznie i precyzyjnie obcinać paznokcie. Ergonomiczny kształt, dzięki któremu obcinacz jest łatwy do trzymania.', '', 'obcinacz-do-paznokci', '', '', '', 'Obcinacz do paznokci', '', '', '', ''),
