(1068633001, 1, 1, 'Nożyczki ze stali węglowej, które pomogą Ci bezpiecznie i precyzyjnie obcinać paznokcie. Ergonomiczny kształt dzięki któremu nożyczki są łatwe do trzymania. Praktyczna wielkość sprawia, że idealnie nadają się do zabrania ze sobą w podróż.', '', 'nozyczki-do-paznokci', '', '', '', 'Nożyczki do paznokci', '', '', '', ''),
(1068636001, 1, 1, 'Dwustronna sonda do robienia kropek na paznokciach z końcówkami ze stali nierdzewnej. Jest to podstawowy przyrząd w sztuce zdobienia paznokci służący do wykonywania kropek i innych wzorów. Sondę można stosować do nakładania różnych rodzajów lakierów (w tym lakieru żelowego) i na różne lakiery, w tym również na powierzchnie akrylowe i żelowe).', '', 'dwustronna-sonda-do-paznokci', '', '', '', 'Dwustronna sonda do paznokci', '', '', '', ''),
(1068637001, 1, 1, 'Dwa pędzelki ze sztucznym włosiem służące do zdobienia paznokci - jeden ze spiczastą końcówką, drugi z płaską. Pędzelki są podstawowym przyrządem w sztuce zdobienia paznokci i służą do wykonywania precyzyjnych wzorów, detali i motywów. Można je stosować do nakładania różnych rodzajów lakierów (w tym lakieru żelowego) i na różne lakiery (w tym również na powierzchnie akrylowe i żelowe).', '', 'pedzelek-do-zdobienia-paznokci-2-pak', '', '', '', 'Pędzelek do zdobienia paznokci 2-pak', '', '', '', ''),
(1068639001, 1, 1, 'Wytrzymały szklany pilniczek do paznokci o drobnoziarnistej powierzchni, którą łatwo wyczyścić.', '', 'szklany-pilnik-do-paznokci', '', '', '', 'Szklany pilnik do paznokci', '', '', '', ''),
(1068642001, 1, 1, 'Zakrzywiony dwustronny pilnik do paznokci z jedną stroną do piłowania, drugą do polerowania.', '', 'dwustronny-pilnik-do-paznokci', '', '', '', 'Dwustronny pilnik do paznokci', '', '', '', ''),
(1068643001, 1, 1, 'Dwustronny pilniczek. Jedna strona do piłowania, a druga do polerowania paznokci.', '', 'dwustronny-pilnik-do-paznokci', '', '', '', 'Dwustronny pilnik do paznokci', '', '', '', ''),
(1068644001, 1, 1, 'Polerka z czterema różnymi powierzchniami do modelowania, wygładzania i polerowania paznokci, by uzyskać idealny lśniący efekt.', '', 'czterostronna-polerka-do-paznokci', '', '', '', 'Czterostronna polerka do paznokci', '', '', '', ''),
