(1091303001, 1, 1, 'Pościel do łóżeczka wykonana z miękkiej bawełnianej tkaniny składająca się z poszwy na kołdrę i poszewki na poduszkę. Pościel ma wzorzyste nadruki z motywami zwierzęcymi, a jej poszczególne elementy można łatwo łączyć z innymi wzorami i kolorami, tworząc indywidualne zestawy. Poszwa zapinana u dołu na kryte zatrzaski, kopertowa poszewka na poduszkę.', '', 'komplet-poscieli-do-lozeczka', '', '', '', 'Komplet pościeli do łóżeczka', '', '', '', ''),
(1091311007, 1, 1, 'Miłe kocyki z bawełnianego muślinu o dobrej przepuszczalności są zawsze przydatne w różnych okolicznościach. Miękki delikatny materiał sprawia, że doskonale nadają się jako kocyk przytulanka lub jako ściereczka Zawsze powinny być pod ręką – w wózku, na macie do przewijania czy w kuchni. Kocyki stają się bardziej miękkie z każdym praniem.', '', 'kocyk-przytulanka-3-pak', '', '', '', 'Kocyk przytulanka 3-pak', '', '', '', ''),
(1092778001, 1, 1, 'Luźne spodnie z miękkiego diagonalu z krytym zapięciem na guzik i haftkę. Rozporek na suwak. Kieszenie w szwach bocznych, z tyłu kieszenie z wypustką i lekko rozszerzane nogawki.', '', 'rozszerzane-spodnie-loose-fit', '', '', '', 'Rozszerzane spodnie Loose Fit', '', '', '', ''),
