(1121514001, 1, 1, 'Edycja limitowana. Zestaw składający się z pięciu pędzli do różnorodnych technik makijażu twarzy i oczu. Pędzle są wykonane z bardzo miękkiego włosia syntetycznego. Zestaw zawiera: pędzel do pudru, ukośny pędzel do różu, okrągły pędzelek do cieni nakładanych na załamanie powieki, ukośny pędzelek do brwi i eyelinera oraz pędzel do rozcierania makijażu.', '', 'pedzel-do-makijazu-5-pak', '', '', '', 'Pędzel do makijażu 5-pak', '', '', '', ''),
(1121909001, 1, 1, 'Edycja limitowana. Lakiery do paznokci we wspaniałej gamie inspirujących kolorów i efektów: od ponadczasowych klasyków po najnowsze trendy. Szybka i łatwa aplikacja – już jedna warstwa lakieru o wysokim połysku zapewnia intensywne i idealnie gładkie wykończenie. 8 ml.', '', 'lakier-do-paznokci', '', '', '', 'Lakier do paznokci', '', '', '', ''),
