(1122477003, 1, 1, 'Obszerna długa sukienka w prążki wykonana z miękkiej dzianiny z mieszanki zawierającej wełnę. Okrągły dekolt, obniżone ramiona i długie rękawy z rozcięciem. Prosty brzeg u dołu i rozcięcie z boku.', '', 'sukienka-oversize-z-prazkowanej-dzianiny', '', '', '', 'Sukienka oversize z prążkowanej dzianiny', '', '', '', ''),
(1122876002, 1, 1, 'Koszula wierzchnia z miękkiego filcu z domieszką wełny. Swobodny fason, kołnierzyk, zapięcie na guziki. Długie rękawy z zapinanym mankietem. Kieszenie na piersi, karczek z tyłu, prosty brzeg u dołu.', '', 'koszula-wierzchnia-relaxed-fit', '', '', '', 'Koszula wierzchnia Relaxed Fit', '', '', '', ''),
(1122971004, 1, 1, 'Spodnie z dzianiny dresowej z mieszanki zawierającej bawełnę. Wewnątrz miękki meszek. Swobodny fason. Elastyczna talia ze sznurkiem, po bokach kieszenie z suwakiem, ściągacz u dołu nogawek. Produkt wykonano z wykorzystaniem technologii THERMOLITE®, która zapewnia komfort cieplny przy minimalnej grubości i wadze materiału.', '', 'spodnie-dresowe-thermolite-relaxed-fit', '', '', '', 'Spodnie dresowe THERMOLITE® Relaxed Fit', '', '', '', ''),
(1122971005, 1, 1, 'Spodnie z dzianiny dresowej z mieszanki zawierającej bawełnę. Wewnątrz miękki meszek. Swobodny fason. Elastyczna talia ze sznurkiem, po bokach kieszenie z suwakiem, ściągacz u dołu nogawek. Produkt wykonano z wykorzystaniem technologii THERMOLITE®, która zapewnia komfort cieplny przy minimalnej grubości i wadze materiału.', '', 'spodnie-dresowe-thermolite-relaxed-fit', '', '', '', 'Spodnie dresowe THERMOLITE® Relaxed Fit', '', '', '', ''),
(1122971006, 1, 1, 'Spodnie z dzianiny dresowej z mieszanki zawierającej bawełnę. Wewnątrz miękki meszek. Swobodny fason. Elastyczna talia ze sznurkiem, po bokach kieszenie z suwakiem, ściągacz u dołu nogawek. Produkt wykonano z wykorzystaniem technologii THERMOLITE®, która zapewnia komfort cieplny przy minimalnej grubości i wadze materiału.', '', 'spodnie-dresowe-thermolite-relaxed-fit', '', '', '', 'Spodnie dresowe THERMOLITE® Relaxed Fit', '', '', '', ''),
