(1123071001, 1, 1, 'Wzorzysty chodnik z bawełnianej tkaniny z długim włosiem, które jest miękkie i przyjemne dla stóp. Frędzelki na krótkich bokach, antypoślizgowy spód.', '', 'puszysty-chodnik-we-wzory', '', '', '', 'Puszysty chodnik we wzory', '', '', '', ''),
(1123073001, 1, 1, 'Puszysty bawełniany dywanik w kształcie wozu strażackiego. Długie włosie sprawia, że jest miękki i przyjemny dla stóp oraz tworzy przytulną atmosferę w pokoju dziecka. Szerokość 71 cm. Długość 126 cm. Antypoślizgowy spód.', '', 'dywanik-w-ksztalcie-wozu-strazackiego', '', '', '', 'Dywanik w kształcie wozu strażackiego', '', '', '', ''),
(1123179001, 1, 1, 'Obszerna koszula wierzchnia z miękkiego filcu. Kołnierzyk, zapięcie na zatrzaski, karczek z tyłu. Długie rękawy z rozcięciem i zapinanym mankietem. Kieszenie na piersi. Z podszewką.', '', 'koszula-wierzchnia-oversized-fit', '', '', '', 'Koszula wierzchnia Oversized Fit', '', '', '', ''),
(1123283001, 1, 1, 'Spodnie z 5 kieszeniami wykonane z bawełnianego diagonalu. Normalny fason. Rozporek na suwak i guzik, proste nogawki.', '', 'spodnie-z-diagonalu-regular-fit', '', '', '', 'Spodnie z diagonalu Regular Fit', '', '', '', ''),
(1124208001, 1, 1, 'Calf-length dress in a jacquard weave. Relaxed fit with a round neckline and an opening with a covered button at the back of the neck. Elbow-length balloon sleeves with narrow elastication at the cuffs, a drawstring at the waist and a gathered seam below the hips for added width. Jersey underdress.', '', 'balloon-sleeved-dress', '', '', '', 'Balloon-sleeved dress', '', '', '', ''),
(1124806002, 1, 1, 'Podkreślająca figurę sukienka do połowy łydki wykonana z puszystej dzianiny. Głęboki dekolt, długie rękawy. Rozcięcie z boku u dołu. Rękawy i dół ze ściągaczem.', '', 'sukienka-z-puszystej-dzianiny', '', '', '', 'Sukienka z puszystej dzianiny', '', '', '', ''),
(1125188001, 1, 1, 'Sukienka z lejącej satyny do połowy łydki. Dekolt w serek, kopertowy przód z szerokim wiązaniem z boku. Kryte wąskie wiązanie na drugim boku. Lekko obniżone ramiona. Odcinana marszczona talia z elastycznym tyłem tworzy lekkie drapowanie. Częściowo z podszewką.', '', 'kopertowa-sukienka-satynowa', '', '', '', 'Kopertowa sukienka satynowa', '', '', '', ''),
(1125231001, 1, 1, 'Pościel do dziecięcego łóżeczka wykonana z bardzo miękkiej bawełnianej tkaniny składająca się z poszwy na kołdrę i poszewki na poduszkę. Pościel ma piękny design, a jej elementy można łatwo łączyć z innymi wzorami i kolorami, tworząc indywidualne zestawy pościeli. Poszwa zapinana u dołu na kryte zatrzaski, kopertowa poszewka na poduszkę.', '', 'komplet-poscieli-do-lozeczka', '', '', '', 'Komplet pościeli do łóżeczka', '', '', '', ''),
(1126030001, 1, 1, 'Mata niemowlęca w kształcie tęczy jest doskonałym miejscem do zabawy i poznawania świata. Na tej macie Twoje dziecko będzie mogło wygodnie leżeć i próbować swoich sił w siadaniu czy raczkowaniu. Wykonana jest z pikowanej bawełnianej tkaniny. Można ją łatwo utrzymać w czystości, ponieważ pierze się ją w pralce. Kolory maty sprawiają, że jest przyjemnym dodatkiem do wystroju pokoju dziecięcego.', '', 'mata-niemowleca-z-bawelny', '', '', '', 'Mata niemowlęca z bawełny', '', '', '', ''),
(1127523001, 1, 1, 'Koszula z przewiewnego lnu. Normalny fason. Wykładany kołnierzyk, klasyczny przód, karczek z tyłu. Długie rękawy z zapinanym mankietem oraz z rozcięciem i guzikiem zabezpieczającym. Zaokrąglony dół. Materiał wykonany z lnu oddycha, wygląda doskonale zarówno wyprasowany, jak i naturalnie pognieciony, a z czasem staje się bardziej miękki.', '', 'lniana-koszula-regular-fit', '', '', '', 'Lniana koszula Regular Fit', '', '', '', ''),
