(1127676004, 1, 1, 'Podwójna pościel z przyjemnej dla skóry tkaniny z mieszanki wiskozy i lnu. Poszwa na kołdrę zapinana u dołu na zatrzaski. Dwie kopertowe poszewki na poduszkę. Len jest wytrzymałym materiałem i przy odpowiedniej pielęgnacji posłuży przez długi czas, a z każdym praniem będzie stawał się bardziej miękki i atrakcyjny. Lniana pościel to dobry wybór dla osób, którym jest zbyt ciepło podczas snu, ponieważ materiał ten absorbuje wilgoć, zapewniając przyjemny chłód i komfort.', '', 'komplet-podwojnej-poscieli-z-domieszka-lnu', '', '', '', 'Komplet podwójnej pościeli z domieszką lnu', '', '', '', ''),
(1128249001, 1, 1, 'Koszulki z miękkiego bawełnianego dżerseju. Głęboki okrągły dekolt i prosty brzeg u dołu.', '', 'bawelniana-koszulka-2-pak', '', '', '', 'Bawełniana koszulka 2-pak', '', '', '', ''),
(1128590002, 1, 1, 'Sukienka do połowy łydki wykonana z tkaniny dobby z mieszanki zawierającej wiskozę LENZING™ ECOVERO™ . Marszczony szew z boku daje efekt drapowania, rozcięcie z przodu u dołu. Okrągły dekolt, z tyłu kryte zapięcie na suwak i haftkę, długie bufiaste rękawy z zapinanym mankietem.', '', 'marszczona-sukienka', '', '', '', 'Marszczona sukienka', '', '', '', ''),
(1128659001, 1, 1, 'Podkreślająca figurę krótka sukienka z miękkiej satyny z ozdobną kokardą z przodu. Gorsetowa góra, bardzo wąskie regulowane odpinane ramiączka. Z tyłu kryty suwak i haftka. Z podszewką.', '', 'sukienka-bodycon-z-kokarda', '', '', '', 'Sukienka bodycon z kokardą', '', '', '', ''),
(1128770001, 1, 1, 'Baby Exclusive. Lekko watowana pikowana mata z bawełnianej tkaniny we wzorzyste nadruki. Mata ma kształt chmurki i jest doskonałym miejscem do zabawy i poznawania świata. Dzieci będą mogły na niej wygodnie leżeć i próbować swoich sił w siadaniu czy raczkowaniu. Długość 120 cm. Szerokość 90 cm.', '', 'mata-niemowleca-w-ksztalcie-chmury', '', '', '', 'Mata niemowlęca w kształcie chmury', '', '', '', ''),
(1128837005, 1, 1, 'Spodnie w stylu roboczym z grubego bawełnianego płótna. Swobodny fason, normalny stan, rozporek na suwak i guzik, proste nogawki. Kieszenie po bokach, kieszonka na monety, kieszenie z tyłu i na nogawkach. Na jednym boku szlufka na narzędzia.', '', 'spodnie-worker-relaxed-fit', '', '', '', 'Spodnie Worker Relaxed Fit', '', '', '', ''),
(1130142001, 1, 1, 'Koszula wierzchnia z grubego bawełnianego denimu. Wykładany kołnierzyk, klasyczny przód, karczek z tyłu i lekko zaokrąglony dół. Normalny fason, na piersi naszywana kieszeń, długie rękawy z rozcięciem i zapinanym mankietem.', '', 'dzinsowa-koszula-wierzchnia-regular-fit', '', '', '', 'Dżinsowa koszula wierzchnia Regular Fit', '', '', '', '');
