(1133953002, 1, 1, 'Joggersy z dzianiny dresowej z mieszanki zawierającej bawełnę. Wewnątrz miękki meszek. Luźny fason. Elastyczna talia ze sznurkiem, ukośne kieszenie po bokach, jedna kieszeń z tyłu. Lekko zwężane nogawki z elastycznym brzegiem.', '', 'joggersy-loose-fit', '', '', '', 'Joggersy Loose Fit', '', '', '', ''),
(1133953003, 1, 1, 'Joggersy z dzianiny dresowej z mieszanki zawierającej bawełnę. Wewnątrz miękki meszek. Luźny fason. Elastyczna talia ze sznurkiem, ukośne kieszenie po bokach, jedna kieszeń z tyłu. Lekko zwężane nogawki z elastycznym brzegiem.', '', 'joggersy-loose-fit', '', '', '', 'Joggersy Loose Fit', '', '', '', ''),
(1134107008, 1, 1, 'Tkaninowa koszula z mieszanki bawełny i lnu. Wykładany kołnierzyk, klasyczna listwa z guzikami, karczek z tyłu. Normalny fason. Długie rękawy z rozcięciem i guzikiem zabezpieczającym oraz z zapinanym mankietem. Mieszanka bawełny i lnu to połączenie miękkości bawełny i wytrzymałości, jaką daje len. Owocem tego jest piękny strukturalny materiał, który oddycha i doskonale się układa.', '', 'koszula-z-domieszka-lnu-regular-fit', '', '', '', 'Koszula z domieszką lnu Regular Fit', '', '', '', ''),
(1134524002, 1, 1, 'Koszula z miękkiej bawełnianej flaneli. Wykładany kołnierzyk, zapięcie na guziki, z tyłu karczek z kontrafałdą. Swobodny fason, kieszeń na piersi, długie rękawy z zapinanym mankietem, lekko zaokrąglony dół.', '', 'flanelowa-koszula-relaxed-fit', '', '', '', 'Flanelowa koszula Relaxed Fit', '', '', '', ''),
