(1155241001, 1, 1, 'Edycja limitowana. Kalendarz odliczający dni do świąt zawierający produkty do domowych zabiegów spa. Podaruj sobie wszystko: od słodko pachnących produktów do ciała, po niezbędne produkty do pielęgnacji skóry. Każdego dnia odkrywaj nowy produkt i czerp radość z codziennej pielęgnacji!  Szczegółowa zawartość: jedna gąbka do kąpieli, jeden płatek do peelingu ust, jeden płatek do oczyszczania twarzy, jeden peeling do ciała (10 ml), jedna kosmetyczna opaska do włosów, jeden balsam do ust (5 ml), pięć kul do kąpieli (5x20 g), trzy mydełka (2x19 g, 1x 21 g), dwa żele pod prysznic (2x10 ml), dwie emulsje do ciała (2x10ml), jeden rozświetlacz do ciała (10 ml), trzy opakowania konfetti do kąpieli (3x3 g) i dwa opakowania soli do kąpieli (2x20 g).', '', 'adwentowy-kalendarz-spa', '', '', '', 'Adwentowy kalendarz spa', '', '', '', ''),
