(1162806001, 1, 1, 'Spodnie outdoorowe z wiatroszczelnego hydrofobowego materiału funkcjonalnego, który ochroni przed lekkim deszczem i wiatrem. Normalny fason. Normalny stan. Rozporek na suwak i zatrzask i częściowo kryty regulowany pasek z magnetyczną klamrą. Ukośne kieszenie po bokach, z tyłu kieszenie z wypustką, na nogawkach kieszenie z suwakiem służące do bezpiecznego przechowywania przedmiotów. Suwaki po bokach poprawiają wentylację, lekko zwężane nogawki z regulowaną patką u dołu. Czterokierunkowy stretch zapewniający maksymalną wygodę i swobodę ruchu.', '', 'przeciwdeszczowe-spodnie-outdoorowe', '', '', '', 'Przeciwdeszczowe spodnie outdoorowe', '', '', '', ''),
(1162901001, 1, 1, 'Koszula wierzchnia z diagonalu z lyocellu. Normalny fason. Kołnierzyk, zapięcie na guziki i długie rękawy z zapinanym mankietem. Na piersi kieszenie z klapką i z guzikiem. Materiał wykonany z lyocellu jest bardzo miękki, odporny na zagniecenia i pięknie się układa.', '', 'koszula-wierzchnia-z-lyocellu-regular-fit', '', '', '', 'Koszula wierzchnia z lyocellu Regular Fit', '', '', '', ''),
(1162919001, 1, 1, 'Koszula z miękkiej bawełnianej popeliny. Swobodny fason. Wykładany kołnierzyk, klasyczny przód, kieszeń na piersi, z tyłu karczek z kontrafałdą. Długie rękawy z rozcięciem i guzikiem zabezpieczającym oraz z zapinanym mankietem. Zaokrąglony dół.', '', 'popelinowa-koszula-relaxed-fit', '', '', '', 'Popelinowa koszula Relaxed Fit', '', '', '', ''),
(1162919002, 1, 1, 'Koszula z miękkiej bawełnianej popeliny. Swobodny fason. Wykładany kołnierzyk, klasyczny przód, kieszeń na piersi, z tyłu karczek z kontrafałdą. Długie rękawy z rozcięciem i guzikiem zabezpieczającym oraz z zapinanym mankietem. Zaokrąglony dół.', '', 'popelinowa-koszula-relaxed-fit', '', '', '', 'Popelinowa koszula Relaxed Fit', '', '', '', ''),
(1164462001, 1, 1, 'Edycja limitowana. Cztery lakiery do paznokci w różnych kolorach i o różnych wykończeniach zapakowane w bombkę choinkową. Idealne jako prezent dla ukochanej osoby, świąteczna niespodzianka dla kogoś lub dla siebie - do powieszenia na swojej choince. 4x2 ml.', '', 'lakier-do-paznokci-w-bombce', '', '', '', 'Lakier do paznokci w bombce', '', '', '', ''),
(1164462002, 1, 1, 'Edycja limitowana. Cztery lakiery do paznokci w różnych kolorach i o różnych wykończeniach zapakowane w bombkę choinkową. Idealne jako prezent dla ukochanej osoby, świąteczna niespodzianka dla kogoś lub dla siebie - do powieszenia na swojej choince. 4x2 ml.', '', 'lakier-do-paznokci-w-bombce', '', '', '', 'Lakier do paznokci w bombce', '', '', '', ''),
(1164469002, 1, 1, 'Outdoorowe spodnie z wiatroszczelnego hydrofobowego materiału funkcjonalnego, który ochroni przed wiatrem i lekkim deszczem. Luźny fason. Elastyczna talia z regulowanym paskiem z magnetyczną klamrą. Rozporek na suwak i zatrzask. Z boku szlufki do mocowania drobnych przedmiotów. Ukośne kieszenie po bokach, z tyłu kieszeń z klapką, na nogawkach mieszkowe kieszenie z klapką. Obszerne nogawki z zaszewkami na kolanach, które dodają objętości. U dołu kryty elastyczny sznurek do ściągania ze stoperem. Bez podszewki.', '', 'outdoorowe-spodnie-spadochronowe', '', '', '', 'Outdoorowe spodnie spadochronowe', '', '', '', ''),
(1164614001, 1, 1, 'Edycja limitowana. Cztery miniaturowe błyszczki do ust w różnych kolorach i o różnych wykończeniach zapakowane w świąteczną bombkę. Idealne jako prezent dla ukochanej osoby, świąteczna niespodzianka dla kogoś lub dla siebie - do powieszenia na swojej choince. 4x0,9 ml.', '', 'blyszczyk-do-ust-w-bombce', '', '', '', 'Błyszczyk do ust w bombce', '', '', '', ''),
(1164615002, 1, 1, 'Edycja limitowana. Dwa pięknie pachnące miniaturowe balsamy do ust. Balsamy są zapakowane w bombkę, która doda blasku Twojej choince. 2x1,2 g.', '', 'balsam-do-ust-w-bombce', '', '', '', 'Balsam do ust w bombce', '', '', '', ''),
(1164628001, 1, 1, 'Edycja limitowana. Paleta dziewięciu niesamowicie brokatowych i błyszczących cieni w różnych kolorach. Mieszaj i łącz, tworząc wyjątkowy świąteczny look! Jeśli brokat na powiekach to za mało, użyj cieni również na ciele. Podpowiedź: nakładaj opuszkami palców, aby uzyskać pełne krycie. 9x0,9 g.', '', 'paleta-cieni-do-powiek', '', '', '', 'Paleta cieni do powiek', '', '', '', ''),
(1164636001, 1, 1, 'Edycja limitowana. Dzięki zestawowi zawierającemu cztery spinki i miękką kosmetyczną opaskę do włosów możesz ułożyć fryzurę lub odsunąć włosy podczas wykonywania świątecznego makijażu. Miękka powierzchnia spinek chroni włosy przed zagnieceniami i odkształceniem.', '', 'zestaw-do-wlosow', '', '', '', 'Zestaw do włosów', '', '', '', ''),
(1165032001, 1, 1, 'Top termiczny z elastycznego polaru DryMove™, który odprowadza wilgoć i pozwala zachować suchą skórę i ciepło, gdy jesteś w ruchu. Wąski fason, stójka, u góry suwak z osłoną przed otarciem, na piersi kieszenie z suwakiem. Długie reglanowe rękawy z otworem na kciuk. Wąskie elastyczne wykończenie brzegów rękawów i dołu. Płaskie szwy zapobiegające podrażnieniu skóry poprawiają komfort i swobodę ruchów.', '', 'polarowy-top-termiczny-drymove', '', '', '', 'Polarowy top termiczny DryMove™', '', '', '', ''),
(1165034001, 1, 1, 'Joggersy sportowe z materiału funkcjonalnego DryMove™, który odprowadza wilgoć i pomaga zachować suchą skórę, gdy jesteś w ruchu.  Wąski fason. Elastyczna talia z krytym sznurkiem.  Po bokach kieszenie z suwakiem, zwężane nogawki z widocznymi szwami.', '', 'joggersy-sportowe-drymove', '', '', '', 'Joggersy sportowe DryMove™', '', '', '', ''),
