(1165474001, 1, 1, 'Trzywarstwowe spodnie narciarskie z oddychającego materiału funkcjonalnego StormMove™, który chroni przed wiatrem i śniegiem. Normalny fason. Regulowane elastyczne szelki, zapięcie na suwak z przodu. Na piersi kieszeń z suwakiem, kieszenie do ogrzewania rąk zapinane na suwak, na jednej nogawce kieszeń z suwakiem. Po bokach talii regulowane patki z zapięciem na rzep, po wewnętrznej stronie nogawek wentylacyjne panele z suwakiem. Na kolanach zaszewki zwiększające swobodę ruchów. U dołu nogawek zintegrowane ochraniacze przeciwśnieżne, które ściśle przylegają do butów narciarskich. Podklejane szwy, współczynnik wodoodporności 15 000 mm. Współczynnik oddychalności 15 000 g/m2/24 godziny.', '', 'trzywarstwowe-spodnie-narciarskie-stormmove', '', '', '', 'Trzywarstwowe spodnie narciarskie StormMove™', '', '', '', ''),
(1165476001, 1, 1, 'Watowane spodnie narciarskie z oddychającego materiału funkcjonalnego StormMove™, który chroni przed wiatrem i śniegiem. Luźny fason, elastyczna talia, pasek z magnetycznym zapięciem, rozporek na suwak i zatrzaski. Po bokach ukośne kieszenie z suwakiem, na nogawkach kieszenie z suwakiem, w tym jedna z zewnętrzną kieszonką z siateczki. Po wewnętrznej stronie nogawek panele wentylacyjne zapinane na suwak. Na kolanach zaszewki dodające objętości i zwiększające swobodę ruchów. Elastyczne brzegi nogawek i kryte metalowe haczyki, przy pomocy których można nogawki przypiąć do butów narciarskich. Podklejane szwy, współczynnik wodoodporności 10 000 mm. Współczynnik oddychalności 10 000 g/m2/24 godziny. Spodnie wykonano z zastosowaniem technologii ThermoMove™, dzięki której materiał ma właściwości termoizolacyjne a jednocześnie jest lekki i oddycha.', '', 'luzne-spodnie-narciarskie-thermomove', '', '', '', 'Luźne spodnie narciarskie ThermoMove™', '', '', '', ''),
(1165476002, 1, 1, 'Watowane spodnie narciarskie z oddychającego materiału funkcjonalnego StormMove™, który chroni przed wiatrem i śniegiem. Luźny fason, elastyczna talia, pasek z magnetycznym zapięciem, rozporek na suwak i zatrzaski. Po bokach ukośne kieszenie z suwakiem, na nogawkach kieszenie z suwakiem, w tym jedna z zewnętrzną kieszonką z siateczki. Po wewnętrznej stronie nogawek panele wentylacyjne zapinane na suwak. Na kolanach zaszewki dodające objętości i zwiększające swobodę ruchów. Elastyczne brzegi nogawek i kryte metalowe haczyki, przy pomocy których można nogawki przypiąć do butów narciarskich. Podklejane szwy, współczynnik wodoodporności 10 000 mm. Współczynnik oddychalności 10 000 g/m2/24 godziny. Spodnie wykonano z zastosowaniem technologii ThermoMove™, dzięki której materiał ma właściwości termoizolacyjne a jednocześnie jest lekki i oddycha.', '', 'luzne-spodnie-narciarskie-thermomove', '', '', '', 'Luźne spodnie narciarskie ThermoMove™', '', '', '', ''),
(1165591003, 1, 1, 'Drewniana kredka do brwi o miękkiej i łatwej do rozcierania formule, która pomoże wypełnić i podkreślić brwi. Możliwość ostrzenia. Wbudowana szpulkowa szczoteczka pozwala rozetrzeć kolor, aby stworzyć naturalny efekt. 1,7 g.', '', 'kredka-do-brwi', '', '', '', 'Kredka do brwi', '', '', '', ''),
