(1192341001, 1, 1, 'rabanne H&amp;M. Przyciągające uwagę eleganckie spodnie z tkaniny o metalicznym połysku z dodatkiem błyszczących nici. Ponadczasowy wąski fason, rozporek an suwak, kryty guzik i dużą haftkę. Ukośne kieszenie z przodu, z tyłu kieszenie z wypustkami i guzikiem. Wąskie nogawki z kantami. Częściowo z tkaninową podszewką z żakardowym monogramem przedstawiającym logo projektanta.', '', 'eleganckie-metaliczne-spodnie-garniturowe', '', '', '', 'Eleganckie metaliczne spodnie garniturowe', '', '', '', ''),
(1192346001, 1, 1, 'rabanne H&amp;M. Sportowe, a jednocześnie modne, spodnie w stylu retro wykonane z grubego dżerseju. Z przodu gumowa aplikacja z logo projektanta. W talii elastyczne marszczenie ze sznurkiem, dyskretne kieszenie w szwach bocznych.Proste nogawki z przeszytymi kantami i kolorowymi lampasami.', '', 'spodnie-sportowe-z-aplikacja', '', '', '', 'Spodnie sportowe z aplikacją', '', '', '', ''),
