(1192975001, 1, 1, 'rabanne H&amp;M. Top bez rękawów wykonany z bardzo miękkiej dzianiny o lekko drapanej powierzchni z mieszanki wełny i moheru. Na piersi błyszczące szklane kamienie strassu tworzące piękny kwiatowy wzór. U góry kryte zapięcie na guziki, na wierzchu listwy z zapięciem ozdobne guziki w kształcie kwiatów ze strassu. Krótki fason podkreślający figurę. Ściągacz wokół szyi, ramion i u dołu.', '', 'top-ze-zdobieniami-i-domieszka-moheru', '', '', '', 'Top ze zdobieniami i domieszką moheru', '', '', '', ''),
(1192993001, 1, 1, 'rabanne x H&amp;M. Sportowa, a jednocześnie modna, bluza w stylu retro wykonana z grubego dżerseju. Gumowa aplikacja na piersi. Reglanowe rękawy z kolorowymi paskami po bokach. Wysoki ściągacz wokół szyi, dwukierunkowy suwak z dużym metalowym uchwytem z wygrawerowanym motywem. Dyskretne kieszenie po bokach, rękawy i dół ze ściągaczem. Przeszyte kanty z przodu i z tyłu. Logo projektanta na aplikacji i na grawerowanym uchwycie.', '', 'bluza-sportowa-z-aplikacja', '', '', '', 'Bluza sportowa z aplikacją', '', '', '', ''),
