(1208226001, 1, 1, 'Długa sukienka z pokrytej cekinami siateczki z dodatkiem błyszczących nici. Okrągły dekolt, na karku małe rozcięcie z guzikiem, długie rękawy. U dołu prosty brzeg i długie rozcięcie z tyłu. Podszewka w postaci krótkiej dżersejowej halki na wąskich regulowanych ramiączkach.', '', 'siateczkowa-sukienka-z-cekinami', '', '', '', 'Siateczkowa sukienka z cekinami', '', '', '', ''),
(1208227002, 1, 1, 'Podkreślająca figurę krótka sukienka z mieszanki zawierającej wiskozę. Odkryte ramiona z krytym silikonowym wykończeniem i elastycznym brzegiem. Dwuwarstwowy przód, długie rękawy, z tyłu kryty suwak i haftka. Bez podszewki.', '', 'sukienka-z-odkrytymi-ramionami', '', '', '', 'Sukienka z odkrytymi ramionami', '', '', '', ''),
(1208415005, 1, 1, 'Podkreślająca figurę krótka sukienka. Dekolt karo, wąskie ramiączka. U dołu prosty brzeg z krótkim rozcięciem z jednej strony z przodu.', '', 'sukienka-bodycon', '', '', '', 'Sukienka bodycon', '', '', '', ''),
(1208476003, 1, 1, 'Podkreślająca figurę sukienka do połowy łydki wykonana z miękkiego dżerseju. Stójka, długie rękawy, prosty brzeg u dołu.', '', 'sukienka-ze-stojka', '', '', '', 'Sukienka ze stójką', '', '', '', ''),
(1208588001, 1, 1, 'Podkreślająca figurę długa sukienka z siateczki zdobiona błyszczącymi kamieniami strassu. Okrągły dekolt, z tyłu kryte zapięcie na suwak i haftkę, watowane ramiona i długie rękawy. Dżersejowa podszewka.', '', 'sukienka-ze-strassem', '', '', '', 'Sukienka ze strassem', '', '', '', ''),
(1208644001, 1, 1, 'Body thong z miękkiego dżerseju z długim rękawem. Okrągły dekolt, odkryte plecy z wiązaniem u góry. Kryte zatrzaski w kroku.', '', 'body-thong-z-odkrytymi-plecami', '', '', '', 'Body thong z odkrytymi plecami', '', '', '', ''),
(1208701001, 1, 1, 'Obszerna bluza z miękkiego polaru z nadrukiem motywu z przodu. Stójka, zapięcie na suwak, obniżone ramiona, elastyczne brzegi rękawów. Dyskretne kieszenie w szwach bocznych.', '', 'rozpinana-bluza-polarowa', '', '', '', 'Rozpinana bluza polarowa', '', '', '', ''),
(1208831002, 1, 1, 'Koszulki z bawełnianego dżerseju. Głęboki okrągły dekolt i prosty brzeg u dołu.', '', 'koszulka-2-pak', '', '', '', 'Koszulka 2-pak', '', '', '', ''),
(1208852001, 1, 1, 'Podkreślający figurę top z miękkiego dżerseju. Dekolt w łódeczkę, długie rękawy i prosty brzeg u dołu.', '', 'dopasowany-top-dzersejowy', '', '', '', 'Dopasowany top dżersejowy', '', '', '', ''),
(1208852002, 1, 1, 'Podkreślający figurę top z miękkiego dżerseju. Dekolt w łódeczkę, długie rękawy i prosty brzeg u dołu.', '', 'dopasowany-top-dzersejowy', '', '', '', 'Dopasowany top dżersejowy', '', '', '', ''),
(1209034001, 1, 1, 'Krótka obszerna sukienka z miękkiej dzianiny w warkoczowy splot. Golfowy kołnierz w prążki, obniżone ramiona, długie rękawy ze ściągaczem. Ściągacz u dołu sukienki.', '', 'dzianinowa-sukienka-z-golfem', '', '', '', 'Dzianinowa sukienka z golfem', '', '', '', ''),
(1209331001, 1, 1, 'Podkreślająca figurę krótka sukienka tkaninowa. Z przodu i z tyłu usztywnienia zapewniające podtrzymanie i kształt, u góry drut w kształcie V tworzący idealny dekolt w serce. Długie rękawy, z tyłu szerokie elastyczne marszczenie i kryty suwak. Bez podszewki.', '', 'sukienka-z-odkrytymi-ramionami', '', '', '', 'Sukienka z odkrytymi ramionami', '', '', '', ''),
(1209357001, 1, 1, 'Krótka sukienka z lejącej satyny. Dekolt w serek, profilowane miseczki, wąskie regulowane ramiączka. Kryty suwak z boku, dopasowana góra i lekko rozszerzany dół. Częściowo z podszewką.', '', 'satynowa-sukienka-na-ramiaczkach', '', '', '', 'Satynowa sukienka na ramiączkach', '', '', '', ''),
(1209372002, 1, 1, 'Pościel z bawełnianej tkaniny we wzorzyste nadruki. Jedna kopertowa poszewka na poduszkę.', '', 'komplet-bawelnianej-poscieli-pojedynczej', '', '', '', 'Komplet bawełnianej pościeli pojedynczej', '', '', '', ''),
(1209376001, 1, 1, 'Pościel z bawełnianej tkaniny we wzory. Jedna kopertowa poszewka na poduszkę.', '', 'komplet-poscieli-pojedynczej-we-wzory', '', '', '', 'Komplet pościeli pojedynczej we wzory', '', '', '', ''),
(1209378003, 1, 1, 'Podkreślająca figurę krótka sukienka z dżerseju pokrytego cekinami. Dekolt w łódeczkę z przodu, głęboki okrągły dekolt z tyłu. Lekko obniżone ramiona i długie rękawy.', '', 'cekinowa-sukienka-z-odkrytymi-plecami', '', '', '', 'Cekinowa sukienka z odkrytymi plecami', '', '', '', ''),
(1209499001, 1, 1, 'Bawełniany dywanik z motywem słonecznika z kępek przędzy będzie stanowić radosny akcent na każdej podłodze. Antypoślizgowy spód.', '', 'bawelniany-dywanik-z-motywem-z-kepek-przedzy', '', '', '', 'Bawełniany dywanik z motywem z kępek przędzy', '', '', '', ''),
(1209529001, 1, 1, 'Puszysty bawełniany dywanik w kształcie rakiety kosmicznej. Długie włosie sprawia, że jest miękki i przyjemny dla stóp oraz tworzy przytulną atmosferę w pokoju dziecka. Wszystkie dzieci zasługują na magiczne dzieciństwo. Dlatego H&amp;M współpracuje z organizacją Save the Children i przekaże 10% ceny sprzedaży tego produktu na wsparcie działań tej organizacji mających na celu zapewnienie dzieciom lepszej przyszłości.', '', 'puszysty-dywanik-w-ksztalcie-rakiety', '', '', '', 'Puszysty dywanik w kształcie rakiety', '', '', '', ''),
(1209748001, 1, 1, 'Podkreślająca figurę długa sukienka z siateczki pokrytej cekinami. Głęboki dekolt z tyłu, mała stójka z zapięciem na haftkę z tyłu. Zaszewki na biuście, długie rękawy i lekko rozszerzany dół. Kryty suwak z boku. Dżersejowa podszewka.', '', 'dluga-sukienka-z-cekinami', '', '', '', 'Długa sukienka z cekinami', '', '', '', ''),
(1209749001, 1, 1, 'Podkreślająca figurę krótka tkaninowa sukienka na jedno ramię. Jedno ramiączko zdobione kamieniami strassu i węzłem, kryty suwak z boku, marszczone szwy boczne tworzące drapowanie. Asymetryczny brzeg. Dżersejowa podszewka.', '', 'sukienka-na-jedno-ramie', '', '', '', 'Sukienka na jedno ramię', '', '', '', ''),
(1209749002, 1, 1, 'Podkreślająca figurę krótka tkaninowa sukienka na jedno ramię. Jedno ramiączko zdobione kamieniami strassu i węzłem, kryty suwak z boku, marszczone szwy boczne tworzące drapowanie. Asymetryczny brzeg. Dżersejowa podszewka.', '', 'sukienka-na-jedno-ramie', '', '', '', 'Sukienka na jedno ramię', '', '', '', ''),
(1209750001, 1, 1, 'Podkreślająca figurę krótka sukienka na jedno ramię wykonana z tkaniny z dodatkiem błyszczących nici. Z przodu obszerna kokarda ciągnąca się przez jedno ramię i tworząca asymetryczny dekolt. U góry kryty silikonowy brzeg, z przodu i z tyłu gorsetowe usztywnienia nadające kształt i zapewniające wsparcie. Kryty suwak i zapięcie na haftkę. Z podszewką.', '', 'sukienka-mini-z-kokarda', '', '', '', 'Sukienka mini z kokardą', '', '', '', ''),
(1209778001, 1, 1, 'Duży tkaninowy chodnik o krótkim włosiu wykonany z mieszanki wełny i bawełny. Kolorowy wzór na wierzchu nadaje wnętrzu zabawny charakter.', '', 'duzy-welniany-chodnik', '', '', '', 'Duży wełniany chodnik', '', '', '', ''),
(1209778002, 1, 1, 'Duży tkaninowy chodnik o krótkim włosiu wykonany z mieszanki wełny i bawełny. Kolorowy wzór na wierzchu nadaje wnętrzu zabawny charakter.', '', 'duzy-welniany-chodnik', '', '', '', 'Duży wełniany chodnik', '', '', '', ''),
(1209830001, 1, 1, 'Podkreślający figurę top z miękkiej dzianiny w prążki. Głęboki okrągły dekolt, długie rękawy z rozcięciem u dołu.', '', 'top-z-dzianiny-w-prazki', '', '', '', 'Top z dzianiny w prążki', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(1209849005, 1, 1, 'Stwórz piękne brwi korzystając z naszej mechanicznej kredki Superfine Browliner, która zmieni rzadkie lub nierówne brwi w naturalnie wyglądające podkreślone łuki. Magia tkwi w bardzo precyzyjnej końcówce, dzięki której można naśladować wygląd naturalnych włosków, stosując dokładne subtelne pociągnięcia i unikając nienaturalnego efektu. 0,05 g.', '', 'precyzyjna-kredka-do-brwi', '', '', '', 'Precyzyjna kredka do brwi', '', '', '', ''),
(1209966002, 1, 1, 'Sukienka do połowy łydki wykonana z tkaniny o lekkim połysku. Głęboki dekolt w serek, kopertowy przód, w talii pasek do wiązania. Długie rękawy zakończone szerokim mankietem z rozcięciem i guzikiem. Bez podszewki.', '', 'kopertowa-sukienka', '', '', '', 'Kopertowa sukienka', '', '', '', ''),
(1210205001, 1, 1, 'Dwurzędowa żakietowa sukienka do połowy łydki wykonana z krepowanego dżerseju. Satynowe spiczaste klapy, zapięcie na obciągane guziki. Watowane ramiona, długie rękawy z długim rozcięciem u dołu. Z przodu kieszenie z wypustkami, zaszewki w talii i rozcięcie z tyłu. Satynowa podszewka.', '', 'dwurzedowa-sukienka-zakietowa', '', '', '', 'Dwurzędowa sukienka żakietowa', '', '', '', ''),
(1210261001, 1, 1, 'Podkreślająca figurę sukienka do połowy łydki wykonana z dżerseju z dodatkiem błyszczących nici. Bardzo wąskie elastyczne ramiączka, dekolt karo, głębokie wycięcia wokół ramion, po bokach marszczenia tworzące drapowanie. Podszewka u góry.', '', 'sukienka-z-brokatowego-dzerseju', '', '', '', 'Sukienka z brokatowego dżerseju', '', '', '', ''),
(1210264002, 1, 1, 'Krótka sukienka z plisowanego dżerseju. Głęboki dekolt w serek, długie rękawy. Marszczone odcięcia pod biustem i z tyłu talii tworzą efekt lekkiego drapowania. Częściowo z podszewką.', '', 'plisowana-sukienka-dzersejowa', '', '', '', 'Plisowana sukienka dżersejowa', '', '', '', ''),
(1210277001, 1, 1, 'Podkreślająca figurę krótka sukienka bez rękawów wykonana z prześwitującej tkaniny. Obszerne falbanki tworzące asymetryczne warstwy. Okrągły dekolt, na karku niewielkie rozcięcie z guzikiem. Z boku kryte zapięcie na suwak i haftkę. Bez podszewki.', '', 'sukienka-mini-z-falbanami', '', '', '', 'Sukienka mini z falbanami', '', '', '', ''),
(1210329001, 1, 1, 'Body z siateczki pokryte kamieniami strassu. Dekolt w serek, kopertowy krój z przodu, watowane ramiona i długie rękawy. Dżersejowy dół, kryte zatrzaski w kroku, średnio kryjący tył. Bez podszewki.', '', 'body-ze-strassem', '', '', '', 'Body ze strassem', '', '', '', ''),
(1210471001, 1, 1, 'Pudełkowy T-shirt z miękkiego bawełnianego dżerseju z nadrukiem. Luźny fason. Ściągacz wokół szyi i obniżone ramiona.', '', 'pudelkowy-t-shirt-z-nadrukiem', '', '', '', 'Pudełkowy T-shirt z nadrukiem', '', '', '', ''),
(1210471002, 1, 1, 'Pudełkowy T-shirt z miękkiego bawełnianego dżerseju z nadrukiem. Luźny fason. Ściągacz wokół szyi i obniżone ramiona.', '', 'pudelkowy-t-shirt-z-nadrukiem', '', '', '', 'Pudełkowy T-shirt z nadrukiem', '', '', '', ''),
(1210471003, 1, 1, 'Pudełkowy T-shirt z miękkiego bawełnianego dżerseju z nadrukiem. Luźny fason. Ściągacz wokół szyi i obniżone ramiona.', '', 'pudelkowy-t-shirt-z-nadrukiem', '', '', '', 'Pudełkowy T-shirt z nadrukiem', '', '', '', ''),
(1210647001, 1, 1, 'Krótki tkaninowy top bandeau w stylu gorsetowym. Kryty silikonowy brzeg u góry utrzymuje top w miejscu. Obciągane guziki wzdłuż przodu, z przodu atrapy kieszeni z wypustkami i klapką. Rozcięcie u dołu. Z podszewką.', '', 'rozpinany-top-gorsetowy', '', '', '', 'Rozpinany top gorsetowy', '', '', '', ''),
(1210811001, 1, 1, 'Podkreślająca figurę krótka sukienka z elastycznego dżerseju z błyszczącymi kamieniami strassu. Zaszyty kopertowy przód, watowane ramiona i długie rękawy. Marszczone szwy na ramionach i po bokach tworzą drapowanie.', '', 'sukienka-ze-strassem', '', '', '', 'Sukienka ze strassem', '', '', '', ''),
(1210830001, 1, 1, 'Podkreślająca figurę długa sukienka z elastycznego dżerseju o lekkim połysku. Okrągły dekolt, głęboki dekolt z tyłu, bardzo długie obcisłe rękawy.', '', 'dluga-sukienka-z-glebokim-dekoltem-z-tylu', '', '', '', 'Długa sukienka z głębokim dekoltem z tyłu', '', '', '', ''),
(1211332001, 1, 1, 'Podkreślający figurę top z elastycznego dżerseju o lekkim połysku. Wąskie regulowane ramiączka, dekolt w serce i dwuwarstwowe profilowane miseczki. Gorsetowe szwy z przodu i z tyłu, elastyczne marszczenie z tyłu i lekko rozszerzana baskinka.', '', 'top-gorsetowy', '', '', '', 'Top gorsetowy', '', '', '', ''),
(1211362001, 1, 1, 'Podkreślający figurę krótki top z elastycznego dżerseju. Jedno szerokie ramiączko i jedno podwójne z wąskich pasków. Zaokrąglony marszczony szew z przodu i marszczone szwy po bokach tworzące efekt lekkiego drapowania.', '', 'asymetryczny-top-z-marszczeniem', '', '', '', 'Asymetryczny top z marszczeniem', '', '', '', ''),
(1211386002, 1, 1, 'Krótka luźna sukienka z tkaniny o strukturalnym splocie. Niska stójka, na karku rozcięcie z krytymi guzikami. Długie baloniaste rękawy o reglanowym kroju z rozcięciem i mankietem zapinanym na guzik. Krótka halka na wąskich regulowanych ramiączkach.', '', 'sukienka-w-strukturalny-wzor', '', '', '', 'Sukienka w strukturalny wzór', '', '', '', ''),
(1211589001, 1, 1, 'Podkreślająca figurę krótka tkaninowa sukienka z odkrytymi ramionami. Krótkie marszczone rękawy, dekolt w serce z wszytym gorsetowym usztywnieniem z przodu, elastycznie marszczona wstawka z tyłu. Z przodu i z tyłu widoczne szwy, z boku kryty suwak. Bawełniana podszewka.', '', 'sukienka-z-odkrytymi-ramionami', '', '', '', 'Sukienka z odkrytymi ramionami', '', '', '', ''),
(1211615001, 1, 1, 'Podkreślająca figurę krótka sukienka z elastycznego dżerseju. Asymetryczny dekolt, na jednym ramieniu podwójne ramiączko z kamieniami strassu. Góra z podszewką.', '', 'sukienka-na-jedno-ramie-zdobiona-strassem', '', '', '', 'Sukienka na jedno ramię zdobiona strassem', '', '', '', ''),
(1211730001, 1, 1, 'Długa sukienka z miękkiego elastycznego dżerseju. Okrągły dekolt, na karku małe rozcięcie z guzikiem. Watowane ramiona, szerokie rękawy 3/4. W talii zaokrąglony marszczony szew tworzący drapowanie u góry. Dopasowany dół. Kryta elastyczna talia, rozcięcie z boku u dołu.', '', 'drapowana-sukienka-dzersejowa', '', '', '', 'Drapowana sukienka dżersejowa', '', '', '', ''),
(1211734002, 1, 1, 'Podkreślający figurę krótki top z miękkiego dżerseju. Dekolt w serek, skręcony detal z przodu, długie rękawy. Po bokach marszczone szwy tworzące drapowanie. Z podszewką.', '', 'dzersejowy-top-ze-skreconym-detalem', '', '', '', 'Dżersejowy top ze skręconym detalem', '', '', '', ''),
(1212088002, 1, 1, 'Koszulka z tkaniny o lekkim połysku. Głęboki okrągły dekolt, tył typu racer, rozcięcia u dołu po bokach. Częściowo z podszewką.', '', 'koszulka-z-tylem-racer', '', '', '', 'Koszulka z tyłem racer', '', '', '', ''),
(1212335001, 1, 1, 'Luźny top z miękkiego dżerseju. Bardzo wąskie ramiączka i dekolt karo.', '', 'dzersejowy-top-na-ramiaczkach', '', '', '', 'Dżersejowy top na ramiączkach', '', '', '', ''),
(1212396001, 1, 1, 'Krótka tkaninowa sukienka zdobiona błyszczącymi koralikami. Okrągły dekolt z przodu i głęboki dekolt w serek z tyłu. Obniżone ramiona, bardzo długie baloniaste rękawy z rozcięciem u dołu. Z tyłu kryte zapięcie na suwak i haftkę, w talii profilujące zaszewki. Z podszewką.', '', 'sukienka-z-koralikami', '', '', '', 'Sukienka z koralikami', '', '', '', ''),
(1212616002, 1, 1, 'Podkreślająca figurę krótka sukienka z miękkiego dżerseju. Okrągły dekolt, długie rękawy, trójkątne wycięcie na plecach. Częściowo z podszewką.', '', 'dzersejowa-sukienka-z-wycieciami', '', '', '', 'Dżersejowa sukienka z wycięciami', '', '', '', ''),
(1213451001, 1, 1, 'Top bandeau z krepowanej tkaniny. U góry asymetryczny odwijany brzeg z marszczeniem, kryty suwak z boku. Kryty silikonowy brzeg u góry utrzymuje top w miejscu.', '', 'top-bandeau', '', '', '', 'Top bandeau', '', '', '', ''),
(1214422001, 1, 1, 'Koszula wierzchnia z bawełnianej tkaniny o strukturalnej powierzchni. Kołnierzyk, zapięcie na guziki. Normalny fason, zapinane mankiety, kieszenie z przodu. Prosty dół.', '', 'bawelniana-koszula-wierzchnia-regular-fit', '', '', '', 'Bawełniana koszula wierzchnia Regular Fit', '', '', '', ''),
(1214423001, 1, 1, 'Koszula z kreszowanej tkaniny. Normalny fason. Wykładany kołnierzyk, klasyczny przód, karczek z tyłu. Długie rękawy z zapinanym mankietem oraz z rozcięciem i guzikiem zabezpieczającym.', '', 'kreszowana-koszula-regular-fit', '', '', '', 'Kreszowana koszula Regular Fit', '', '', '', ''),
(1214660001, 1, 1, 'Podkreślający figurę top z miękkiej dzianiny w prążki z mieszanki zawierającej wełnę. Golfowy kołnierz, bardzo długie rękawy, wycięcie z przodu.', '', 'top-z-domieszka-welny', '', '', '', 'Top z domieszką wełny', '', '', '', ''),
(1214660002, 1, 1, 'Podkreślający figurę top z miękkiej dzianiny w prążki z mieszanki zawierającej wełnę. Golfowy kołnierz, bardzo długie rękawy, wycięcie z przodu.', '', 'top-z-domieszka-welny', '', '', '', 'Top z domieszką wełny', '', '', '', ''),
(1215026001, 1, 1, 'Podkreślający figurę krótki top z grubego dżerseju z głębokim dekoltem w serce. Z przodu i z tyłu usztywnienie zapewniające kształt i podtrzymanie. Suwak z tyłu. Z podszewką.', '', 'polgorset-z-dekoltem-w-serce', '', '', '', 'Półgorset z dekoltem w serce', '', '', '', ''),
(1215783001, 1, 1, 'Top z ażurowej dzianiny z mieszanki zawierającej jedwab zdobionej błyszczącymi cekinami. Długie rękawy. Okrągły dekolt. Lekko obniżone ramiona. Pod spodem dzianinowy top na regulowanych ramiączkach.', '', 'cekinowy-top-z-mieszanki-zawierajacej-jedwab', '', '', '', 'Cekinowy top z mieszanki zawierającej jedwab', '', '', '', ''),
(1216563001, 1, 1, 'Edycja limitowana. Za pomocą tych metalowych spinek możesz ułożyć fryzurę lub spiąć włosy podczas wykonywania makijażu. Długość 8,8 cm.', '', 'spinka-do-wlosow-6-pak', '', '', '', 'Spinka do włosów 6-pak', '', '', '', ''),
(1216563002, 1, 1, 'Edycja limitowana. Za pomocą tych metalowych spinek możesz ułożyć fryzurę lub spiąć włosy podczas wykonywania makijażu. Długość 8,8 cm.', '', 'spinka-do-wlosow-6-pak', '', '', '', 'Spinka do włosów 6-pak', '', '', '', ''),
(1216894001, 1, 1, 'Miękki koc z misia z polarowym spodem.', '', 'kocyk-pluszowy', '', '', '', 'Kocyk pluszowy', '', '', '', ''),
(1217399001, 1, 1, 'Dżersejowa sukienka do połowy łydki. Długie rękawy, watowane ramiona, głęboki dekolt w serek, w talii skręcony detal, który tworzy lekkie drapowanie i ładnie podkreśla sylwetkę. U dołu prosty brzeg z rozcięciem z przodu.', '', 'sukienka-ze-skreconym-detalem', '', '', '', 'Sukienka ze skręconym detalem', '', '', '', ''),
(1217400001, 1, 1, 'Podkreślająca figurę sukienka do połowy łydki. Asymetryczny dekolt, jedno szerokie ramiączko z metalowym detalem z przodu. Kryty suwak z boku, lekkie drapowanie w talii, rozcięcie z tyłu u dołu. Bez podszewki.', '', 'sukienka-na-jedno-ramie', '', '', '', 'Sukienka na jedno ramię', '', '', '', ''),
(1217409001, 1, 1, 'Podkreślająca figurę krótka sukienka bandeau z tkaniny. Kryty silikonowy brzeg u góry utrzymuje ją w miejscu. Zapięcie na guziki, z przodu atrapy kieszeni z klapką. Z przodu i z tyłu profilujące zaszewki podkreślające sylwetkę. Bez podszewki.', '', 'sukienka-bandeau', '', '', '', 'Sukienka bandeau', '', '', '', ''),
(1218623002, 1, 1, 'Krótka tiulowa sukienka. Gorsetowa marszczona góra z usztywnieniem zapewniającym podtrzymanie i kształt, u góry drut w kształcie V tworzący idealny dekolt w serce. Kryty suwak z tyłu. Obszerny wielowarstwowy dół. Z podszewką.', '', 'obszerna-sukienka-tiulowa', '', '', '', 'Obszerna sukienka tiulowa', '', '', '', ''),
(1218988002, 1, 1, 'Podkreślający figurę top z miękkiego bawełnianego dżerseju w prążki. Okrągły dekolt i długie rękawy.', '', 'bawelniany-top-w-prazki', '', '', '', 'Bawełniany top w prążki', '', '', '', ''),
(1218988003, 1, 1, 'Podkreślający figurę top z miękkiego bawełnianego dżerseju w prążki. Okrągły dekolt i długie rękawy.', '', 'bawelniany-top-w-prazki', '', '', '', 'Bawełniany top w prążki', '', '', '', ''),
(1218988004, 1, 1, 'Podkreślający figurę top z miękkiego bawełnianego dżerseju w prążki. Okrągły dekolt i długie rękawy.', '', 'bawelniany-top-w-prazki', '', '', '', 'Bawełniany top w prążki', '', '', '', ''),
(1220540001, 1, 1, 'Luźny T-shirt z miękkiego bawełnianego dżerseju z okrągłym dekoltem i watowanymi ramionami.', '', 't-shirt-z-watowanymi-ramionami', '', '', '', 'T-shirt z watowanymi ramionami', '', '', '', ''),
(1220540002, 1, 1, 'Luźny T-shirt z miękkiego bawełnianego dżerseju z okrągłym dekoltem i watowanymi ramionami.', '', 't-shirt-z-watowanymi-ramionami', '', '', '', 'T-shirt z watowanymi ramionami', '', '', '', ''),
(1220614001, 1, 1, 'Koszula wierzchnia z waflowego dżerseju z mieszanki bawełny i lyocellu. Kołnierzyk, zapięcie na guziki. Normalny fason, długie rękawy z zapinanym mankietem, kieszeń na piersi i prosty brzeg u dołu.', '', 'waflowa-koszula-wierzchnia-regular-fit', '', '', '', 'Waflowa koszula wierzchnia Regular Fit', '', '', '', ''),
(1220618001, 1, 1, 'Dżersejowa koszula o strukturalnej powierzchni. Normalny fason. Wykładany kołnierzyk, klasyczny przód, kieszeń na piersi. Długie rękawy z zapinanym mankietem oraz z rozcięciem i guzikiem zabezpieczającym.', '', 'koszula-o-strukturalnej-powierzchni-regular-fit', '', '', '', 'Koszula o strukturalnej powierzchni Regular Fit', '', '', '', ''),
(1222182001, 1, 1, 'Edycja limitowana. Kółko do kluczy z dwoma miniaturowymi błyszczykami w połyskujących odcieniach wraz z uroczym pomponem. Przymocuj kółko do swoich kluczy lub torby sportowej, a będziesz błyszczeć i lśnić, gdziekolwiek jesteś. 2x2,2 ml.', '', 'kolko-do-kluczy-z-blyszczykiem-do-ust', '', '', '', 'Kółko do kluczy z błyszczykiem do ust', '', '', '', ''),
(1222717001, 1, 1, 'Edycja limitowana. Miękka welurowa opaska do przytrzymywania włosów podczas nakładania maseczki kosmetycznej, makijażu czy wykonywania innych zabiegów pielęgnacyjnych twarzy.', '', 'kosmetyczna-opaska-na-glowe', '', '', '', 'Kosmetyczna opaska na głowę', '', '', '', ''),
(1222735001, 1, 1, 'Edycja limitowana. Lusterko w kształcie serca z nadrukiem. Długość 18,5 cm. Szerokość 11,5 cm.', '', 'lusterko-w-ksztalcie-serca', '', '', '', 'Lusterko w kształcie serca', '', '', '', ''),
(1223023001, 1, 1, 'Sukienka z lejącej satyny z mieszanki zawierającej lyocell. Długość do połowy łydki. Głęboki dekolt w serek, obniżone ramiona, długie rękawy i szerokie mankiety z rozcięciem. Rozszerzany dół z klinowymi wstawkami dodającymi objętości. Bez podszewki.', '', 'satynowa-sukienka-z-domieszka-lyocellu', '', '', '', 'Satynowa sukienka z domieszką lyocellu', '', '', '', ''),
(1223037002, 1, 1, 'Podkreślający figurę krótki top bez rękawów wykonany z elastycznego dżerseju. Duża kokarda z przodu i prosty brzeg u dołu.', '', 'dzersejowy-top-z-kokarda', '', '', '', 'Dżersejowy top z kokardą', '', '', '', ''),
(1223235002, 1, 1, 'Podkreślający figurę top z miękkiej dzianiny z mieszanki wełny i kaszmiru. Okrągły dekolt, krótkie rękawy.', '', 'top-z-domieszka-kaszmiru', '', '', '', 'Top z domieszką kaszmiru', '', '', '', ''),
(1224112001, 1, 1, 'Koszula z miękkiej tkaniny z mieszanki zawierającej bawełnę o supełkowej powierzchni. Normalny fason, wykładany kołnierzyk, klasyczny przód, karczek z tyłu. Długie rękawy z zapinanym mankietem oraz z rozcięciem i guzikiem zabezpieczającym. Lekko zaokrąglony dół.', '', 'koszula-o-supelkowej-powierzchni-regular-fit', '', '', '', 'Koszula o supełkowej powierzchni Regular Fit', '', '', '', ''),
(1224113001, 1, 1, 'Koszula wierzchnia z grubej tkaniny w jodełkę. Wykładany kołnierzyk, klasyczny przód. Normalny fason, rękawy zapinanym mankietem, kieszeń na piersi i prosty brzeg u dołu.', '', 'koszula-wierzchnia-w-jodelke-regular-fit', '', '', '', 'Koszula wierzchnia w jodełkę Regular Fit', '', '', '', ''),
(1224114002, 1, 1, 'Koszula z bawełnianej tkaniny o waflowym splocie. Wykładany kołnierzyk, klasyczna listwa z zapięciem, kieszonka na piersi. Długie rękawy z zapinanym mankietem. Prosty brzeg u dołu. Normalny fason o wygodnym klasycznym kroju.', '', 'waflowa-koszula-regular-fit', '', '', '', 'Waflowa koszula Regular Fit', '', '', '', ''),
(1224311003, 1, 1, 'Podkreślający figurę top z miękkiej dzianiny w prążki. Odkryte ramiona, odwinięty brzeg u góry, długie rękawy.', '', 'prazkowany-dzianinowy-top-z-odkrytymi-ramionami', '', '', '', 'Prążkowany dzianinowy top z odkrytymi ramionami', '', '', '', ''),
(1224311004, 1, 1, 'Podkreślający figurę top z miękkiej dzianiny w prążki. Odkryte ramiona, odwinięty brzeg u góry, długie rękawy.', '', 'prazkowany-dzianinowy-top-z-odkrytymi-ramionami', '', '', '', 'Prążkowany dzianinowy top z odkrytymi ramionami', '', '', '', ''),
(1224891001, 1, 1, 'Podkreślająca figurę krótka tkaninowa sukienka bez rękawów. Głęboki dekolt w serek, zapięcie na guziki. Z przodu atrapy kieszeni z wypustkami, z przodu i z tyłu zaszewki podkreślające sylwetkę. Z podszewką.', '', 'sukienka-z-guzikami-z-przodu', '', '', '', 'Sukienka z guzikami z przodu', '', '', '', ''),
(1224891002, 1, 1, 'Podkreślająca figurę krótka tkaninowa sukienka bez rękawów. Głęboki dekolt w serek, zapięcie na guziki. Z przodu atrapy kieszeni z wypustkami, z przodu i z tyłu zaszewki podkreślające sylwetkę. Z podszewką.', '', 'sukienka-z-guzikami-z-przodu', '', '', '', 'Sukienka z guzikami z przodu', '', '', '', ''),
(1225863001, 1, 1, 'Spodnie z dżerseju bouclé. Elastyczna talia z krytym sznurkiem, rozporek na suwak i guzik. Kieszenie po bokach, z tyłu kieszenie z wypustką. Normalny fason o wygodnym klasycznym kroju.', '', 'spodnie-z-dzerseju-boucle-regular-fit', '', '', '', 'Spodnie z dżerseju bouclé Regular Fit', '', '', '', ''),
(1225867001, 1, 1, 'Koszula z dżerseju bouclé. Wykładany kołnierzyk, gładka listwa z zapięciem, kieszeń na piersi, karczek z tyłu. Długie rękawy z zapinanym mankietem, u dołu prosty brzeg z rozcięciem po bokach. Normalny fason o wygodnym klasycznym kroju.', '', 'koszula-z-dzerseju-boucle-regular-fit', '', '', '', 'Koszula z dżerseju bouclé Regular Fit', '', '', '', ''),
(1227920001, 1, 1, 'Podkreślająca figurę krótka sukienka z elastycznego dżerseju. Jedno odkryte ramię i jedno szerokie ramiączko z dużą kokardą z przodu. Widoczne szwy wzdłuż przodu, prosty brzeg u dołu.', '', 'sukienka-na-jedno-ramie', '', '', '', 'Sukienka na jedno ramię', '', '', '', ''),
(1230073001, 1, 1, 'Długa luźna sukienka z prześwitującego szyfonu. Stójka z długimi tasiemkami wiązanymi w dużą kokardę. Długie reglanowe rękawy z wąskim mankietem. U dołu zakrzywiony marszczony szew dodający objętości. Częściowo z podszewką.', '', 'szyfonowa-sukienka-z-wiazaniem-przy-szyi', '', '', '', 'Szyfonowa sukienka z wiązaniem przy szyi', '', '', '', '');
