INSERT INTO `ps_translation` (`id_translation`, `id_lang`, `key`, `translation`, `domain`, `theme`) VALUES
(1, 1, 'Recycled packaging:', 'Opakowania z recyklingu:', 'EmailsBody', NULL),
(2, 1, 'Review this credit slip and download it on our shop, go to the <a href=\"{order_slip_url}\" target=\"_blank\">%credit_slips_label%</a> section of your customer account.', 'Zrecenzuj ten kupon kredytowy i pobierz go ze sklepu, przejdź do sekcji <a href=\"{order_slip_url}\" target=\"_blank\">%credit_slips_label%</a> swojego konta klienta.', 'EmailsBody', NULL),
(3, 1, 'You need to choose a specific shop to display the top 10 most added products', 'Musisz wybrać konkretny sklep, aby wyświetlić 10 najczęściej dodawanych produktów.', 'ModulesBlockwishlistAdmin', NULL),
(4, 1, 'Allow customers to create wishlists to save their favorite products for later.', 'Pozwól klientom tworzyć listy życzeń, aby zapisywać swoje ulubione produkty na później.\n', 'ModulesBlockwishlistAdmin', NULL),
(5, 1, 'The product will be removed from \"%nameofthewishlist%\".', 'Produkt zostanie usunięty z \"%nameofthewishlist%\".\n', 'ModulesBlockwishlistShop', NULL),
(6, 1, 'Delete wishlist', 'Usuń listę życzeń', 'ModulesBlockwishlistShop', NULL),
(7, 1, 'Remove product from wishlist', 'Usuń produkt z listy życzeń', 'ModulesBlockwishlistShop', NULL);
